import React, { useState } from 'react';
import Square from "./square"
import Lawn from "./lawn"

class BimBamJob extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      size: props.size,
    };
  }

  render() {
	   return (
      <div className="game">
  	   	 <span> Size {this.props.size} </span>
         <Lawn size={parseInt(this.state.size)} /> 
      </div>
	   )
	}
}

export default BimBamJob
